"original": |2-
     This REQUIRED Printer attribute identifies the natural language(s)
     that the Printer and contained Jobs support in attributes with
     attribute syntaxes 'text' and 'name'.  The natural language(s)
     supported depends on implementation and/or configuration.  Unlike
     charsets, Printers MUST accept requests with any natural language or
     any Natural Language Override whether the natural language is
     supported or not.
"fixed": |-
  This REQUIRED Printer attribute identifies the natural language(s) that the Printer and contained Jobs support in attributes with attribute syntaxes 'text' and 'name'.  The natural language(s) supported depends on implementation and/or configuration.  Unlike charsets, Printers MUST accept requests with any natural language or any Natural Language Override whether the natural language is supported or not.
"ko": |-
  이 필수 프린터 속성은 속성 구문 '텍스트' 및 '이름'을 사용하여 프린터 및 포함된 작업이 속성에서 지원하는 자연 언어를 식별합니다. 지원되는 자연어는 구현 및/또는 구성에 따라 다릅니다. 문자 집합과 달리 프린터는 자연어 지원 여부에 관계없이 자연어 또는 자연어 재정의가 포함된 요청을 수락해야 합니다.
